import * as React from 'react'

export default function PokemonList(props) {
  console.log()

  return (
    <div>
      <h1>List of pokemon</h1>
      <ul>

        {props.pokemons && props.pokemons.map(pokemon =>
          <li key={pokemon.id}>
            {pokemon.id}
            <a href onclick={props.show}>{pokemon.name}</a>
          </li>
        )}
      </ul>
    </div>
  )
}
